import React from "react";
import Analytics from "./Analytics";
import Header from "./Header";
import Sidebar from "./Sidebar";
const MondayDashboard = () => {
  return (
    <div>
      <body>
        <Header></Header>
        <div>
          <Sidebar></Sidebar>
        </div>
        <div>
          <Analytics></Analytics>
        </div>
      </body>
    </div>
  );
};
export default MondayDashboard;
